                <ul class="text-[1rem] font-medium text-left  max-w-2xl list-disc  mt-5 text-gray-500">
                    <li>NABPLO is the national association of BPLO chiefs in the country.</li>
                    <li>NABPLO was organized in 1998 under the leadership of Las Pi√±as City BPLO Chief Boni Riguerra, the first NABPLO president.</li>
                    <li>NABPLO traces its roots from MEMBPLO, the Metro Manila Business Permits and Licensing Officers, Inc. founded in 1989 by Quezon City BPLO Chief Pat Dumlao.</li>
                  
